// SPDX-License-Identifier: MIT

pragma solidity ^0.8;

contract UserRegister {


    uint public _c_id =0;
    uint public _u_id =0;
    uint public t_id=0;
    //uint public _t_id=0;

    // structure for User
    struct User {
        uint Addhaarid;
        string name;
        string location;
        uint age;
        string gender;
        uint contact;
        address add;
        uint id;
    }
    struct Company{
        uint lice;
        string name;
        string blocation;
        address cadd;
        uint cid;
    }

    struct Policy {
        uint policy_id;
        string policy_name;
        uint premium_monthly;
        uint ploy_year;
        uint reimburse;
        string company_name;
        address company_add;
        uint i_cid;
    }
    struct Track_Insu{
        uint Adhr_tid;
        uint usr_id;
        uint ins_id;
        uint com_id;
        address uadd;
        address cadd;
        uint tid;
    }

    //mapping(uint=> Company) c1;
    mapping(address => Company) c1;
    mapping (address => User) u1;
    mapping(uint => Policy) p1;
    mapping (uint =>Track_Insu) t1;
    // Creating array of student structure
    User[] person;
    Company[] company;
